import React from "react";
import { effectin, effectin1, effectin2 } from "../styles/effect.styles";

const Preloader = () => {
  return (
    <section id="preloader">
      <effectin />
      <effectin1 />
      <effectin2 />
      <div className="text">
        <div className="spinner"></div>
      </div>
    </section>
  );
};

export default Preloader;
